@copilot 

This else if chain is going to get very unwieldy. Let's instead use some string parsing and switch statements to clean it up.

Something like:
```
var testParts = id.Split('_');
var language = testParts[0] switch
{
  "cs" => CSharp,
  "js" => JavaScript,
  _ => CSharp, // Backwards compatibiilty
};

var difficulty = testParts[1] switch
{
  "easy" => Easy,
  "medium" => Medium,
 ...
};
```

Or, perhaps even better, add a `GetProblemById(id)` method to each class, then loop through them and find the first one that returns an object.

